// Documentation - https://docs.mongodb.com/realm-legacy/docs/javascript/latest/index.html#queries
'use strict';
({params, imports}) => {
    return params.db.objects('Individual').filter((individual) => individual.voided === false && !_.isNil(individual.findObservation('ABHA Creation Error')));
};

'use strict';
({params, imports}) => {
    return params.db.objects('Individual').filter((individual) => individual.voided === false && _.isNil(individual.findObservation('ABHA Number')) && _.isNil(individual.findObservation('ABHA Creation Error')) );
};

